import React from 'react';
import { useAuth } from '../context/AuthContext';
import { Link } from 'react-router-dom';

const Dashboard = () => {
  const { user, logout } = useAuth(); // Access user and logout from context

  // Safely access coordinator details
  const firstName = user?.coor_fname || "User";
  const lastName = user?.coor_lname || "";

  const handleLogout = () => {
    logout(); // Call logout when the button is clicked
  };

  return (
    <div>
      <h1>Dashboard</h1>
      <p>Welcome, {firstName} {lastName}!</p>
      <button onClick={handleLogout}>Log Out</button>

      <nav>
        <Link to='/profile'>Profile</Link>
      </nav>

      {/* Debugging stored user data */}
      <p>Stored User Data: {JSON.stringify(user)}</p> 
    </div>
  );
};

export default Dashboard;
